import { StyleSheet } from "aphrodite/no-important";

export default StyleSheet.create({
  test: {
    backgroundcolor: "#ffffff",
    border: "1px solid #e0e0e0",
    borderradius: "10px",
    margintop: "55px",
    paddingleft: "40px",
    paddingright: "40px",
    paddingtop: "64px",
    paddingbottom: "64px",
    width: "428px",
    height: "566px",
    textalign: "center"
  }
});
